DROP TABLE IF EXISTS sk_access
CREATE TABLE `sk_access` (  `role_id` int(5) NOT NULL,  `node_id` int(5) NOT NULL,  KEY `role_id` (`role_id`),  KEY `node_id` (`node_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_ad
CREATE TABLE `sk_ad` (  `id` smallint(5) NOT NULL AUTO_INCREMENT,  `board_id` smallint(5) NOT NULL,  `type` varchar(20) NOT NULL,  `name` varchar(50) NOT NULL,  `url` varchar(255) NOT NULL,  `code` text NOT NULL,  `start_time` int(10) NOT NULL,  `end_time` int(10) NOT NULL,  `clicks` int(10) NOT NULL DEFAULT '0',  `add_time` int(10) NOT NULL,  `ordid` int(10) NOT NULL,  `status` tinyint(1) NOT NULL DEFAULT '1',  PRIMARY KEY (`id`),  KEY `board_id` (`board_id`,`start_time`,`end_time`,`status`)) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_adboard
CREATE TABLE `sk_adboard` (  `id` smallint(5) NOT NULL AUTO_INCREMENT,  `name` varchar(50) NOT NULL,  `type` varchar(20) NOT NULL,  `width` smallint(5) NOT NULL,  `height` smallint(5) NOT NULL,  `description` varchar(255) NOT NULL,  `status` tinyint(1) NOT NULL DEFAULT '0',  PRIMARY KEY (`id`)) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_address
CREATE TABLE `sk_address` (  `addr_id` int(10) unsigned NOT NULL,  `usr_id` int(10) unsigned DEFAULT NULL,  `consignee` varchar(60) DEFAULT NULL,  `region_id` int(10) unsigned DEFAULT NULL,  `region_name` varchar(255) DEFAULT NULL,  `address` varchar(255) DEFAULT NULL,  `zipcode` varchar(20) DEFAULT NULL,  `phone_tel` varchar(60) DEFAULT NULL,  `phone_mob` varchar(60) DEFAULT NULL,  PRIMARY KEY (`addr_id`),  KEY `usr_idx` (`usr_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_admin
CREATE TABLE `sk_admin` (  `id` int(10) NOT NULL AUTO_INCREMENT,  `user_name` varchar(50) NOT NULL,  `password` varchar(100) NOT NULL,  `add_time` int(10) DEFAULT NULL,  `last_time` int(10) DEFAULT NULL,  `status` tinyint(1) unsigned NOT NULL DEFAULT '1',  `role_id` int(10) NOT NULL,  PRIMARY KEY (`id`)) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_article
CREATE TABLE `sk_article` (  `id` int(10) unsigned NOT NULL,  `cate_id` tinyint(4) unsigned NOT NULL,  `title` varchar(255) NOT NULL,  `orig` varchar(255) NOT NULL,  `img` varchar(255) NOT NULL,  `url` varchar(255) NOT NULL,  `abst` varchar(500) NOT NULL,  `info` mediumtext NOT NULL,  `add_time` int(11) DEFAULT NULL,  `ordid` tinyint(4) NOT NULL,  `is_hot` tinyint(1) NOT NULL DEFAULT '0',  `is_best` tinyint(1) NOT NULL DEFAULT '0',  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0-待审核 1-已审核',  `seo_title` varchar(255) NOT NULL,  `seo_keys` varchar(255) NOT NULL,  `seo_desc` text NOT NULL,  `hits` int(10) NOT NULL DEFAULT '0',  PRIMARY KEY (`id`),  KEY `is_best` (`is_best`),  KEY `add_time` (`add_time`),  KEY `cate_id` (`cate_id`)) ENGINE=MyISAM AUTO_INCREMENT=21 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_article_cate
CREATE TABLE `sk_article_cate` (  `id` smallint(4) unsigned NOT NULL AUTO_INCREMENT,  `name` varchar(100) NOT NULL,  `alias` varchar(50) NOT NULL,  `pid` smallint(4) unsigned NOT NULL,  `status` tinyint(1) NOT NULL DEFAULT '1',  `article_nums` int(10) unsigned NOT NULL,  `sort_order` smallint(4) unsigned NOT NULL,  `seo_title` varchar(255) NOT NULL,  `seo_keys` varchar(255) NOT NULL,  `seo_desc` text NOT NULL,  PRIMARY KEY (`id`)) ENGINE=MyISAM AUTO_INCREMENT=22 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_cart
CREATE TABLE `sk_cart` (  `rec_id` int(10) unsigned NOT NULL,  `usr_id` int(10) unsigned DEFAULT NULL,  `session_id` varchar(32) NOT NULL,  `goods_id` int(10) unsigned DEFAULT NULL,  `spac_id` int(10) unsigned DEFAULT NULL,  `spefification` varchar(255) DEFAULT NULL,  `price` decimal(10,2) unsigned DEFAULT NULL,  `quantity` int(10) unsigned DEFAULT NULL,  `goods_image` varchar(255) DEFAULT NULL,  PRIMARY KEY (`rec_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_cooper
CREATE TABLE `sk_cooper` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `usrname` varchar(50) DEFAULT NULL,  `phone` varchar(50) DEFAULT NULL,  `address` varchar(255) DEFAULT NULL,  `remark` text,  `add_time` int(11) DEFAULT '0',  `status` int(11) DEFAULT '0' COMMENT '审核状态 1未审核 2已审核 3已删除',  `aduit_time` int(11) DEFAULT '0' COMMENT '审核时间',  `ip` varchar(50) DEFAULT NULL,  `utime` int(11) DEFAULT '0',  `flag` int(11) DEFAULT '0',  PRIMARY KEY (`id`)) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='合作申请'
DROP TABLE IF EXISTS sk_feedback
CREATE TABLE `sk_feedback` (  `id` int(10) NOT NULL AUTO_INCREMENT,  `title` varchar(220) NOT NULL COMMENT '反馈主题',  `content` text NOT NULL COMMENT '反馈内容',  `corpname` varchar(120) NOT NULL COMMENT '单位名称',  `address` varchar(240) NOT NULL COMMENT '单位地址',  `zipcode` varchar(20) DEFAULT NULL,  `linker` varchar(20) NOT NULL COMMENT '联系人',  `mobile` varchar(20) NOT NULL COMMENT '联系手机',  `fax` varchar(20) DEFAULT NULL COMMENT '电子传真',  `email` varchar(50) DEFAULT NULL COMMENT '电子邮箱',  `add_time` int(10) NOT NULL DEFAULT '0' COMMENT '添加时间',  `add_ip` varchar(20) NOT NULL COMMENT '提交ip',  `status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '数据状态 0未审核 1已审核 2删除',  `visit_time` int(10) NOT NULL DEFAULT '0' COMMENT '回访时间',  `visit_status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '回访状态 0未回访 1已回访',  `visit_conx` text COMMENT '回访内容',  `visit_usrid` int(10) NOT NULL DEFAULT '0' COMMENT '回访登记人',  `visit_usrname` varchar(50) DEFAULT NULL,  `usr_id` int(10) DEFAULT '0',  `telphone` varchar(20) DEFAULT NULL,  PRIMARY KEY (`id`)) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_flink
CREATE TABLE `sk_flink` (  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,  `cate_id` smallint(4) NOT NULL DEFAULT '1',  `img` varchar(255) DEFAULT NULL,  `name` varchar(100) NOT NULL,  `url` varchar(255) NOT NULL,  `status` tinyint(1) NOT NULL DEFAULT '0',  `ordid` smallint(5) NOT NULL,  PRIMARY KEY (`id`)) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_flink_cate
CREATE TABLE `sk_flink_cate` (  `id` smallint(4) NOT NULL AUTO_INCREMENT,  `name` varchar(255) NOT NULL,  PRIMARY KEY (`id`)) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_focus
CREATE TABLE `sk_focus` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `cate_id` int(11) NOT NULL,  `title` varchar(255) NOT NULL,  `url` varchar(255) NOT NULL,  `img` varchar(255) NOT NULL,  `abst` text NOT NULL,  `clicks` int(10) NOT NULL DEFAULT '0',  `ordid` smallint(4) NOT NULL,  `status` tinyint(1) NOT NULL,  PRIMARY KEY (`id`),  KEY `status` (`status`),  KEY `ordid` (`ordid`)) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_focus_cate
CREATE TABLE `sk_focus_cate` (  `id` smallint(6) NOT NULL AUTO_INCREMENT,  `name` varchar(50) NOT NULL,  `width` smallint(6) NOT NULL DEFAULT '0',  `height` smallint(6) NOT NULL DEFAULT '0',  PRIMARY KEY (`id`)) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_goods
CREATE TABLE `sk_goods` (  `id` int(10) NOT NULL AUTO_INCREMENT,  `cate_id` smallint(4) DEFAULT NULL COMMENT '产品分类',  `good_name` varchar(255) DEFAULT NULL COMMENT '产品名称',  `img` varchar(255) DEFAULT NULL COMMENT '原始图片',  `simg` varchar(255) DEFAULT NULL COMMENT '小图片',  `bimg` varchar(255) DEFAULT NULL COMMENT '大图片',  `url` varchar(1000) DEFAULT NULL COMMENT '链接地址',  `hits` int(10) NOT NULL DEFAULT '0' COMMENT '浏览次数',  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '数据状态 1有效0无效默认为0',  `add_time` int(10) NOT NULL DEFAULT '0' COMMENT '添加时间',  `seo_title` varchar(255) DEFAULT NULL,  `seo_keys` varchar(255) DEFAULT NULL,  `seo_desc` varchar(250) DEFAULT NULL,  `desc` text COMMENT '详细资料',  `recom` int(4) NOT NULL DEFAULT '0' COMMENT '是该推荐 1推荐0不推荐 默认0',  `sort_order` int(4) NOT NULL DEFAULT '2' COMMENT '显示顺序，数越大越靠前',  `pcode` varchar(20) NOT NULL COMMENT '产品编号',  `closed` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否关闭 1关闭0 不关闭 默认不关闭',  `close_reason` varchar(255) DEFAULT NULL COMMENT '关闭原因',  `last_time` int(10) NOT NULL COMMENT '更新时间',  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '单价',  `tags` varchar(102) DEFAULT NULL COMMENT '标签,以,分割',  `remark` varchar(300) DEFAULT NULL COMMENT '产品备注',  `guige` varchar(200) DEFAULT NULL COMMENT '产品规格',  PRIMARY KEY (`id`),  KEY `cid` (`cate_id`),  KEY `title` (`good_name`),  KEY `recom` (`recom`),  KEY `cate_ix` (`cate_id`),  KEY `status_ix` (`status`)) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_goods_spec
CREATE TABLE `sk_goods_spec` (  `spec_id` int(10) unsigned NOT NULL,  `goods_id` int(10) unsigned DEFAULT NULL,  `spec_1` varchar(60) DEFAULT NULL,  `sku` varchar(60) DEFAULT NULL,  `spec_2` varchar(60) DEFAULT NULL,  `price` decimal(10,2) DEFAULT NULL,  PRIMARY KEY (`spec_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_goods_statistics
CREATE TABLE `sk_goods_statistics` (  `goods_id` int(10) unsigned NOT NULL,  `views` int(10) unsigned NOT NULL,  `collents` int(10) unsigned NOT NULL,  `carts` int(10) unsigned NOT NULL,  `orders` int(10) unsigned NOT NULL,  `sales` int(10) unsigned NOT NULL,  `comments` int(10) unsigned NOT NULL,  PRIMARY KEY (`goods_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_group
CREATE TABLE `sk_group` (  `id` smallint(3) unsigned NOT NULL AUTO_INCREMENT,  `name` varchar(25) NOT NULL,  `title` varchar(50) NOT NULL,  `create_time` int(11) unsigned NOT NULL,  `update_time` int(11) unsigned NOT NULL DEFAULT '0',  `status` tinyint(1) unsigned NOT NULL DEFAULT '0',  `sort` smallint(3) unsigned NOT NULL DEFAULT '0',  PRIMARY KEY (`id`),  KEY `status` (`status`),  KEY `sort` (`sort`)) ENGINE=MyISAM AUTO_INCREMENT=30 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_items_cate
CREATE TABLE `sk_items_cate` (  `id` smallint(4) NOT NULL AUTO_INCREMENT,  `name` varchar(50) NOT NULL,  `keywords` varchar(128) NOT NULL,  `img` varchar(255) DEFAULT NULL,  `pid` smallint(4) NOT NULL DEFAULT '0',  `item_nums` int(10) NOT NULL DEFAULT '0',  `item_likes` int(11) NOT NULL,  `ordid` smallint(4) NOT NULL DEFAULT '0',  `tags` varchar(50) NOT NULL,  `is_hots` tinyint(1) NOT NULL DEFAULT '0',  `status` tinyint(1) NOT NULL DEFAULT '1',  `recommend` int(1) NOT NULL DEFAULT '0' COMMENT '0表示不推荐，1表示推荐',  `import_status` int(1) NOT NULL DEFAULT '1',  `seo_title` varchar(255) NOT NULL,  `seo_keys` varchar(255) NOT NULL,  `color` varchar(255) DEFAULT NULL,  `seo_desc` text NOT NULL,  `matching_title` varchar(2000) DEFAULT NULL,  PRIMARY KEY (`id`),  KEY `index_is_hots` (`is_hots`),  KEY `ordid` (`ordid`),  KEY `index_pid` (`pid`,`recommend`,`status`),  KEY `status` (`status`)) ENGINE=MyISAM AUTO_INCREMENT=14 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_member
CREATE TABLE `sk_member` (  `flag` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '账户状态',  `usrid` int(10) NOT NULL AUTO_INCREMENT,  `usrname` varchar(50) NOT NULL,  `usrpwd` varchar(255) NOT NULL,  `logincount` int(11) DEFAULT '0' COMMENT '登录次数',  `email` varchar(60) NOT NULL DEFAULT '',  `real_name` varchar(30) DEFAULT NULL,  `gender` tinyint(3) DEFAULT '0',  `birthday` int(10) DEFAULT '0',  `phone_tel` varchar(60) DEFAULT NULL,  `phone_mob` varchar(60) DEFAULT NULL,  `im_qq` varchar(60) DEFAULT NULL,  `im_weixin` varchar(60) DEFAULT NULL,  `reg_ip` varchar(30) NOT NULL,  `reg_time` int(10) unsigned DEFAULT '0',  `last_login` int(10) unsigned DEFAULT NULL,  `last_ip` varchar(30) DEFAULT NULL,  `logins` int(10) unsigned DEFAULT '0',  `portrait` varchar(255) DEFAULT NULL,  `activation` varchar(200) DEFAULT NULL,  `feed_config` text,  `province` int(10) DEFAULT NULL,  `city` int(10) DEFAULT NULL,  `county` int(10) DEFAULT NULL,  PRIMARY KEY (`usrid`)) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_nav
CREATE TABLE `sk_nav` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `name` varchar(255) NOT NULL,  `alias` varchar(50) NOT NULL,  `url` varchar(255) NOT NULL,  `sort_order` smallint(4) NOT NULL,  `system` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1-系统 0-自定义',  `type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '导航位置1-顶部 2-底部',  `in_site` tinyint(1) NOT NULL COMMENT '1-本站内 0-站外',  `is_show` tinyint(1) NOT NULL DEFAULT '1',  `seo_title` varchar(255) NOT NULL,  `seo_keys` text NOT NULL,  `seo_desc` text NOT NULL,  `items_cate_id` int(11) DEFAULT NULL COMMENT '//分类id',  PRIMARY KEY (`id`),  KEY `is_show` (`is_show`),  KEY `type` (`type`),  KEY `sort_order` (`sort_order`),  KEY `alias` (`alias`)) ENGINE=MyISAM AUTO_INCREMENT=20 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_node
CREATE TABLE `sk_node` (  `id` smallint(6) unsigned NOT NULL AUTO_INCREMENT,  `module` varchar(255) NOT NULL,  `module_name` varchar(50) NOT NULL,  `action` varchar(255) NOT NULL,  `action_name` varchar(50) DEFAULT NULL,  `data` varchar(255) DEFAULT NULL,  `status` tinyint(1) DEFAULT '0',  `remark` varchar(255) DEFAULT NULL,  `sort` smallint(6) unsigned NOT NULL DEFAULT '0',  `auth_type` tinyint(1) NOT NULL DEFAULT '0',  `group_id` tinyint(3) unsigned DEFAULT '0',  `often` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0-不常用 1-常用',  `is_show` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0-不常用 1-常用',  PRIMARY KEY (`id`),  KEY `status` (`status`),  KEY `module` (`module`),  KEY `auth_type` (`auth_type`),  KEY `is_show` (`is_show`),  KEY `group_id` (`group_id`),  KEY `sort` (`sort`)) ENGINE=MyISAM AUTO_INCREMENT=278 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_order_extm
CREATE TABLE `sk_order_extm` (  `order_id` int(10) unsigned NOT NULL,  `consignee` varchar(60) NOT NULL,  `region_id` int(10) unsigned DEFAULT NULL,  `region_name` varchar(255) DEFAULT NULL,  `address` varchar(255) DEFAULT NULL,  `zipcode` varchar(20) DEFAULT NULL,  `phone_tel` varchar(60) DEFAULT NULL,  `phone_mob` varchar(60) DEFAULT NULL,  PRIMARY KEY (`order_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_order_goods
CREATE TABLE `sk_order_goods` (  `rec_id` int(10) unsigned NOT NULL AUTO_INCREMENT,  `order_id` int(10) unsigned NOT NULL COMMENT '订单id',  `goods_id` int(10) unsigned NOT NULL COMMENT '商品id',  `goods_name` varchar(255) NOT NULL COMMENT '商品名称',  `spec_id` int(10) unsigned NOT NULL COMMENT '规格编号',  `specification` varchar(255) DEFAULT NULL COMMENT '规格名称',  `price` decimal(10,2) unsigned NOT NULL COMMENT '价格',  `quantity` int(10) unsigned NOT NULL COMMENT '商品数量',  `goods_images` varchar(255) DEFAULT NULL COMMENT '商品图片',  `evaluation` tinyint(1) unsigned DEFAULT NULL,  `commet` varchar(255) NOT NULL COMMENT '商品描述',  `is_valid` tinyint(1) unsigned DEFAULT '1' COMMENT '是否有效 1有效 0无效',  `goods_code` varchar(20) DEFAULT NULL,  PRIMARY KEY (`rec_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_order_log
CREATE TABLE `sk_order_log` (  `log_id` int(10) unsigned NOT NULL AUTO_INCREMENT,  `order_id` int(10) unsigned NOT NULL,  `operator` varchar(60) NOT NULL,  `order_status` varchar(60) NOT NULL,  `chaged_status` varchar(60) NOT NULL,  `remark` varchar(255) DEFAULT NULL,  `log_time` int(10) unsigned NOT NULL,  PRIMARY KEY (`log_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_orders
CREATE TABLE `sk_orders` (  `shipping_name` varchar(100) DEFAULT NULL,  `order_id` int(10) unsigned NOT NULL AUTO_INCREMENT,  `order_sn` varchar(10) NOT NULL COMMENT '订单号',  `buyer_id` int(10) unsigned NOT NULL COMMENT '购买人',  `buyer_name` varchar(100) NOT NULL COMMENT '购买人',  `buyer_email` varchar(60) DEFAULT NULL,  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '订单状态',  `add_time` int(10) unsigned NOT NULL COMMENT '下单时间',  `payment_id` int(10) unsigned DEFAULT NULL COMMENT '支付方式',  `payment_name` varchar(100) DEFAULT NULL COMMENT '支付方式名称',  `payment_code` varchar(20) DEFAULT NULL COMMENT '支付订单号',  `out_trade_sn` varchar(10) DEFAULT NULL COMMENT '外部交易号',  `pay_time` int(10) NOT NULL DEFAULT '0' COMMENT '支付时间',  `pay_message` varchar(255) DEFAULT NULL COMMENT '支付信息',  `goods_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品总价',  `order_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单总价',  `finish_time` int(10) NOT NULL DEFAULT '0' COMMENT '订单完成时间',  `ship_time` int(10) NOT NULL DEFAULT '0' COMMENT '发货时间',  `discount` decimal(10,2) DEFAULT NULL COMMENT '折扣',  `postscript` varchar(255) DEFAULT NULL COMMENT '买家附言',  `invoice_no` varchar(255) DEFAULT NULL COMMENT '发货单号',  PRIMARY KEY (`order_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_payment
CREATE TABLE `sk_payment` (  `payment_id` int(10) unsigned NOT NULL,  `payment_code` varchar(20) NOT NULL,  `payment_name` varchar(100) NOT NULL,  `payment_desc` varchar(255) DEFAULT NULL,  `config` text,  `is_online` tinyint(3) unsigned DEFAULT NULL,  `enabled` tinyint(3) unsigned DEFAULT NULL,  `sort_order` tinyint(3) unsigned DEFAULT NULL,  PRIMARY KEY (`payment_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_region
CREATE TABLE `sk_region` (  `region_id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,  `region_parent_id` smallint(5) unsigned NOT NULL DEFAULT '0',  `region_name` varchar(120) NOT NULL DEFAULT '',  `region_type` tinyint(1) NOT NULL DEFAULT '2',  PRIMARY KEY (`region_id`),  KEY `city_parent_id` (`region_parent_id`),  KEY `citytype` (`region_type`)) ENGINE=MyISAM AUTO_INCREMENT=3409 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_role
CREATE TABLE `sk_role` (  `id` smallint(6) unsigned NOT NULL AUTO_INCREMENT,  `name` varchar(20) NOT NULL,  `status` tinyint(1) unsigned DEFAULT NULL,  `remark` varchar(255) DEFAULT NULL,  `create_time` int(11) unsigned NOT NULL,  `update_time` int(11) unsigned NOT NULL,  PRIMARY KEY (`id`),  KEY `status` (`status`)) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_seo
CREATE TABLE `sk_seo` (  `description` text,  `keywords` text,  `title` varchar(250) DEFAULT NULL,  `actionname` varchar(30) DEFAULT NULL,  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,  PRIMARY KEY (`id`),  KEY `actionname` (`actionname`)) ENGINE=MyISAM AUTO_INCREMENT=19 DEFAULT CHARSET=utf8
DROP TABLE IF EXISTS sk_setting
CREATE TABLE `sk_setting` (  `name` varchar(100) NOT NULL,  `data` text NOT NULL,  KEY `name` (`name`)) ENGINE=MyISAM DEFAULT CHARSET=utf8
